                    </NavLink>
                    <NavLink to="/workexperience" className="text-xl my-[5%] " onClick={workScroll}>
                        Work Experience
                    </NavLink>
                    <NavLink to="/skills" className="text-xl my-[5%]" onClick={skillsScroll} >
                        Skills
                    </NavLink>
                    <NavLink to="/projects&activities" className="text-xl my-[5%]" onClick={projectsScroll} >
                        Projects and Activities
                    </NavLink>
                    <NavLink to="/contact" className="text-xl my-[5%] lg:mb-36" onClick={contactScroll} >
                        Contact
                    </NavLink>

                </ul>
            </div>

        </TopNav>


